script: |
  super -f text -I q10788.spq | sort > q10788.out

inputs:
  - name: q10788.spq
    data: |
      SELECT DISTINCT + 81 AS col1 FROM tab0 (FORMAT parquet) AS cor0 WHERE col2 NOT BETWEEN ( - col2 ) AND - 69 / + col2 + + col2;
  - name: tab0

outputs:
  - name: q10788.out
    data: |
      81
